- input: 'TEXT,F3XN,,"The Tennessee Leader Victory Fund is a joint fundraising committee
    registered with the Federal Election Commission.  The committee exists to raise
    funds for its participants.  The committee is administered by volunteers and pays
    Wachovia for banking services.  The only expenses incurred by this committee are
    for fundraising.  The committee will have fundraising events periodically and
    will be paying the expenses that arise from those events.  A detailed review of
    our reports will show that our expenses are disclosed adequately and accurately.                                               There
    were no expenditures made on behalf of specifically identified federal candidates
    on Schedule B supporting Line 21(b) of the Detailed Summary Page.  These payments
    are on the appropriate line as they do not require Schedules E or F. The Tennessee
    Leader Victory Fund is a joint fundraising committee that exists to raise money
    for its participants.  A review of our FEC Form 1 will show that the following
    committees are listed as participants: Tennessee Republican Senate Nominee General
    Election Committee, Volunteer PAC and the National Republican Senatorial Committee."'
